column8:
　高校生・大学生の為に作った「チーム」シリーズ。 大きめシルエットが部活・サークルにぴったりのジャージパンツ。カラーコードがデザインのアクセントに。右腿に入ったリニアロゴが、シンプルながらもブランドの存在感を出す。 ソフトタッチ且つ吸汗速乾性に優れたClimalite(クライマライト)機能搭載。紫外線対策にも適したUPF25。<br>

■カラー：BK BQ6796(ブラック)、NV BQ6792(カレッジネイビー)、DGY BQ6791(DGH ソリッドグレー)<br>

■サイズ：S、M、L、O<br>

■素材：ダブルニット<br>

■品質：ポリエステル100%<br>
